import React from 'react';
import './App.css';
import Post from './Post';

function App() {
  return (
    <div className="app">

      <div className='app_header'>
        <img
          className='header_image'
          src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
          alt=""
        />
      </div>

      <div className='below_header'>
        <Post username="imvk._" caption="Nature is Everthing" imageUrl="https://static.vecteezy.com/system/resources/previews/004/965/419/original/deer-in-the-forest-beautiful-sunset-scenery-illustration-free-vector.jpg" />
        <Post username="imraki._" caption="Technology is the future" imageUrl="https://img.etimg.com/thumb/msid-88634316,width-1200,height-900,imgsize-65126,resizemode-8,quality-100/tech/technology/tracking-the-buzz-in-tech.jpg" />
        <Post username="immoni._" caption="I love instagram" imageUrl="https://cdn.telanganatoday.com/wp-content/uploads/2022/05/Instagram-users-irked-with-the-new-update.jpg" />
        <Post username="kunal_kothari._" caption="Business Model on Moral Values" imageUrl="https://www.insperity.com/wp-content/uploads/trust_and_respect_in_workplace1200x630.png" />
        <Post username="som_siwani" caption="Scarpio is everything" imageUrl="https://park.shifting-gears.com/wp-content/uploads/2020/04/Mahindra-Scorpio.jpg" />
      </div>
    </div>
  );
}

export default App;
